import React from 'react';
import * as S from './styles';



import BANNER from '../../assets/BANNER.png';
import diarista from '../../assets/diarista.png';

function Banner() {
  return (
     <S.Container>
      <img src={BANNER} alt="BANNER"/>



     </S.Container> 
  )
} 

export default Banner;
